const HASH = `
import "hashes/pedersen/512bit.zok" as hash

def main (private u32[8] preImg, toCompare u32[8]):
    u32[8] ans = hash([...preImg, ...preImg])
    assert(ans == toCompare)
    return
`;
export default HASH;
